  const[data,setData]=useState()

  function fetchMoreListItems() {}

  useEffect(()=>{
    fetch(`http://localhost:9000/issues`).then(res=>res.json())
    .then(res=>setData(res))
  })
console.log(data)
  return (
    <>
    {data===undefined?<Loading />:data.map(data=>data.title)}
      <div className="issues" data-testid="issues"></div>
      {/* <Loading /> */}
    </>
  );
}

